# Dmitriyevka, Pervomaysky Selsoviet, Meleuzovsky District, Republic of Bashkortostan

}}
Dmitriyevka () is a rural locality (a village) in Pervomaysky Selsoviet, Meleuzovsky District, Bashkortostan, Russia. The population was 5 as of 2010.
Geography
It is located 12&nbsp;km from Meleuz, 5&nbsp;km from Pervomayskaya.
